namespace _992._Subarrays_with_K_Different_Integers;

abstract class Solution
{
    static void Main()
    {
        var (nums, k) = GetInitialNumbers();
        var results = SubarraysWithKDistinct(nums, k);
        OutputResult(results);
        
    }

    private static void OutputResult(int result)
    {
        Console.Write(result);
    }

    private static int  SubarraysWithKDistinct(int[] nums, int k)
    {
        var goodSubarrays = 0;
        var temporaryListOfDistinctNumbers = new List<int>();
        
        for (var i = 0; i < nums.Length; i++)
        {
            temporaryListOfDistinctNumbers.Clear();
            
            for (var j = i; j < nums.Length; j++)
            {
                if (!temporaryListOfDistinctNumbers.Contains(nums[j]))
                    temporaryListOfDistinctNumbers.Add(nums[j]);
                
                var distinctNumbers = temporaryListOfDistinctNumbers.Count;
                if (distinctNumbers == k)
                    goodSubarrays++;
                else if (distinctNumbers > k)
                    break;
            }

            if (goodSubarrays == 0)
            {
                break;
            }
        }

        return goodSubarrays;
    }

